import React, {useState} from 'react';
import {Button, ButtonContainer} from './ButtonStyled.js';

const ButtonComponent = ({weight, hight, setResult}) => {
const [value, setValue] = useState(0);



  return (   
     
    <ButtonContainer>
        <Button w = {weight} h = {hight} setResult = {value} type = "submit" onClick = {setValue((weight / Math.pow(hight, 2)))} >Calcular</Button> 
    </ButtonContainer>
        
  );
}

export default ButtonComponent;
